  <script type="text/javascript">
    $(function(){
      $('.mapRegion').on('click', function () {
        var prefecture = $(this).data('prefecture');
        if(prefecture){
          window.location.href = "{{ route('tourism') }}/" + prefecture;
          return false;
        }
        var name = $(this).data('name');
        $('#list_'+name).addClass('is-active');
        $('#dialog').dialog('open');
      });
      $('.mapRegion').mouseover(function () {
        var name = $(this).data('name');
        $('#label_'+name).addClass('is-active');
      });
      $('.mapRegion').mouseout(function () {
        var name = $(this).data('name');
        $('#label_'+name).removeClass('is-active');
      });
      $('.mapLabel').on('click', function () {
        var prefecture = $(this).data('prefecture');
        if(prefecture){
          window.location.href = "{{ route('tourism') }}/" + prefecture;
          return false;
        }
        var name = $(this).data('name');
        $('#list_'+name).addClass('is-active');
        $('#dialog').dialog('open');
      });
      $('.mapLabel').mouseover(function () {
        var name = $(this).data('name');
        $('#'+name).addClass('is-active');
      });
      $('.mapLabel').mouseout(function () {
        var name = $(this).data('name');
        $('#'+name).removeClass('is-active');
      });
    });
  </script>
